import{_ as i,c as a,o as e,aQ as t}from"./chunks/framework.CtsLwA2Q.js";const r="/vitePress/assets/image-1.CgtYWJE9.png",o="/vitePress/assets/image-2.Dx19RBui.png",s="/vitePress/assets/image-3.BGh7k--3.png",n="/vitePress/assets/image-4.Dd73-6Dk.png",h="/vitePress/assets/image-4.Dd73-6Dk.png",p="/vitePress/assets/image-6.B8E4gP-b.png",x=JSON.parse('{"title":"APP上架各应用市场流程","description":"","frontmatter":{},"headers":[],"relativePath":"front/mini/publish/index.md","filePath":"front/mini/publish/index.md"}'),u={name:"front/mini/publish/index.md"};function d(c,l,_,m,P,b){return e(),a("div",null,l[0]||(l[0]=[t('<h1 id="app上架各应用市场流程" tabindex="-1">APP上架各应用市场流程 <a class="header-anchor" href="#app上架各应用市场流程" aria-label="Permalink to &quot;APP上架各应用市场流程&quot;">​</a></h1><h2 id="安卓应用市场前置准备" tabindex="-1">安卓应用市场前置准备 <a class="header-anchor" href="#安卓应用市场前置准备" aria-label="Permalink to &quot;安卓应用市场前置准备&quot;">​</a></h2><ol><li>开发完成的可安装的Apk，及其相关介绍，图标，截图等</li><li>各大应用商店的开发者账号，注册公司主体一般需要邮箱、手机号、营业执照、税务登记证、组织机构代码（三证合一的只需要营业执照）、企业法人身份证正反面、法人手持身份证照片</li><li>APP软著或者电子版权证明</li><li>隐私采集协议</li><li>其它平台资质要求</li></ol><p>各个平台的上架流程基本一致，都分为以下几个节点：</p><p>1.注册-2.实名认证-3.创建应用-4.编辑应用信息-5.上传安装包-6.提交审核</p><h2 id="腾讯应用宝" tabindex="-1">腾讯应用宝 <a class="header-anchor" href="#腾讯应用宝" aria-label="Permalink to &quot;腾讯应用宝&quot;">​</a></h2><p>腾讯应用宝是腾讯公司推出的应用分发平台，是Android应用上架的重要渠道之一。以下是详细的上架流程：</p><h3 id="_1-注册开发者账号" tabindex="-1">1. 注册开发者账号 <a class="header-anchor" href="#_1-注册开发者账号" aria-label="Permalink to &quot;1. 注册开发者账号&quot;">​</a></h3><ol><li>访问<a href="https://app.open.qq.com/p/developer/reg" target="_blank" rel="noreferrer">腾讯开放平台</a></li><li>选择开发者类型（个人/企业） <img src="'+r+'" alt="alt text"></li><li>填写基本信息并提交相关资质 <ul><li>企业：营业执照、法人身份证等</li><li>个人：身份证、手机号验证等</li></ul></li><li>等待审核通过（一般1-3个工作日）</li></ol><h3 id="_2-应用信息准备" tabindex="-1">2. 应用信息准备 <a class="header-anchor" href="#_2-应用信息准备" aria-label="Permalink to &quot;2. 应用信息准备&quot;">​</a></h3><ol><li><p>应用安装包（APK文件）</p><ul><li>文件大小不超过2GB</li><li>适配Android 4.4及以上系统</li><li>已完成签名</li></ul></li><li><p>应用材料</p><ul><li>应用图标（512x512px，PNG格式）</li><li>应用截图（至少4张，16:9比例）</li><li>应用简介（详细描述应用功能特点）</li><li>应用分类（选择合适的类别）</li></ul></li><li><p>隐私政策相关</p><ul><li>隐私政策文档</li><li>收集个人信息清单</li><li>SDK使用说明</li></ul></li></ol><h3 id="_3-提交审核" tabindex="-1">3. 提交审核 <a class="header-anchor" href="#_3-提交审核" aria-label="Permalink to &quot;3. 提交审核&quot;">​</a></h3><ol><li>登录<a href="https://open.qq.com/" target="_blank" rel="noreferrer">应用宝开发者平台</a></li><li>创建新应用 <img src="'+o+'" alt="alt text"></li><li>填写应用基本信息 <ul><li>应用名称</li><li>应用类型</li><li>应用子分类</li><li>应用运营方</li><li>应用研发方</li><li>应用简介</li></ul></li></ol><p><img src="'+s+'" alt="alt text"> 4. 上传应用材料</p><ul><li>APK文件</li><li>应用图标</li><li>应用截图</li><li>隐私政策</li></ul><p><img src="'+n+'" alt="alt text"></p><p><img src="'+h+'" alt="alt text"></p><p><img src="'+p+'" alt="alt text"> 5. 提交审核</p><h3 id="_4-审核要点" tabindex="-1">4. 审核要点 <a class="header-anchor" href="#_4-审核要点" aria-label="Permalink to &quot;4. 审核要点&quot;">​</a></h3><ol><li><p>合规性要求</p><ul><li>应用内容符合法律法规</li><li>无侵权行为</li><li>符合隐私政策要求</li></ul></li><li><p>技术要求</p><ul><li>应用稳定性</li><li>性能表现</li><li>兼容性测试</li></ul></li><li><p>内容要求</p><ul><li>应用信息真实准确</li><li>截图与实际功能一致</li><li>分类准确</li></ul></li></ol><h3 id="_5-审核时间与发布" tabindex="-1">5. 审核时间与发布 <a class="header-anchor" href="#_5-审核时间与发布" aria-label="Permalink to &quot;5. 审核时间与发布&quot;">​</a></h3><ul><li>首次提交：3-7个工作日</li><li>版本更新：1-3个工作日</li><li>审核通过后自动上架</li><li>可在开发者平台查看审核进度</li></ul><h3 id="_6-应用运营" tabindex="-1">6. 应用运营 <a class="header-anchor" href="#_6-应用运营" aria-label="Permalink to &quot;6. 应用运营&quot;">​</a></h3><ol><li><p>版本更新</p><ul><li>提前准备更新内容</li><li>按流程提交新版本</li><li>做好更新说明</li></ul></li><li><p>数据分析</p><ul><li>下载量统计</li><li>用户反馈处理</li><li>评分管理</li></ul></li><li><p>推广运营</p><ul><li>关键词优化</li><li>应用描述优化</li><li>活动参与</li></ul></li></ol><h3 id="_7-注意事项" tabindex="-1">7. 注意事项 <a class="header-anchor" href="#_7-注意事项" aria-label="Permalink to &quot;7. 注意事项&quot;">​</a></h3><ol><li><p>审核被拒处理</p><ul><li>仔细阅读拒绝原因</li><li>针对性修改</li><li>及时回复审核意见</li></ul></li><li><p>安全事项</p><ul><li>定期更新应用</li><li>及时修复漏洞</li><li>做好用户数据保护</li></ul></li><li><p>政策遵守</p><ul><li>关注平台政策更新</li><li>及时调整应用内容</li><li>保持合规运营</li></ul></li></ol><h2 id="苹果应用市场" tabindex="-1">苹果应用市场 <a class="header-anchor" href="#苹果应用市场" aria-label="Permalink to &quot;苹果应用市场&quot;">​</a></h2><h2 id="小米应用市场" tabindex="-1">小米应用市场 <a class="header-anchor" href="#小米应用市场" aria-label="Permalink to &quot;小米应用市场&quot;">​</a></h2><h2 id="华为应用市场" tabindex="-1">华为应用市场 <a class="header-anchor" href="#华为应用市场" aria-label="Permalink to &quot;华为应用市场&quot;">​</a></h2><h2 id="百度手机助手" tabindex="-1">百度手机助手 <a class="header-anchor" href="#百度手机助手" aria-label="Permalink to &quot;百度手机助手&quot;">​</a></h2>',30)]))}const f=i(u,[["render",d]]);export{x as __pageData,f as default};
